        data.store = arr

        data.store = random(arr)
      }
      if (location.search.indexOf('reverse') > -1) {
        data.store = arr.reverse()
      }
      function random (arr) { 
        for (var i = arr.length - 1; i >= 0; i--) { 
          var randomIndex = Math.floor(Math.random()*(i+1))
          var itemAtIndex = arr[randomIndex]
          arr[randomIndex] = arr[i] 
          arr[i] = itemAtIndex
        }
        return arr
      }


      createItem(domStore, data.store)

      function createItem (dom, data) {
        if (typeof data === 'string') {
          dom.insertAdjacentHTML('beforeEnd', '<li><img src="' + data + '"></li>')
        } else if (typeof data === 'object') {
          data = data.map(function (str) {
            return '<li><img src="' + str + '"></li>'
          })
          dom.insertAdjacentHTML('beforeEnd', data.join(''))
        }
      }
